import React from 'react'
import { Link } from "react-router-dom";
export default function Footer() {
    
  return (
    <>
    <div style={{position:"absolute",bottom:"1px",height:"25px",width:"100%",backgroundColor:"grey"}}>
        <Link style={{textDecoration:"none",color:"white"}}>Conditions of Use & Sale</Link>
        <Link style={{textDecoration:"none",color:"white",marginLeft:"5px"}}>Privacy Notice</Link>
        <Link style={{textDecoration:"none",color:"white",marginLeft:"10px"}}>Interest-Based Ads</Link>
    </div>
    </>
  )
}
